import React, {Component} from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css"
import Button from '@material-ui/core/Button';
import axios from 'axios';

export default class UserNavbar extends Component {

    constructor(props) {
        super(props);
        this.logout = this.logout.bind(this);
    }

    logout(){
        axios.get("http://localhost:4000/recruiter/logout")
             .then(res => {
                    // console.log(res);
                    console.log(res.data);
             })
             .catch(function(error) {
                 console.log(error);
             })
        window.open("..","_self");
    }

    render() {
        return (
            <div>                
                <nav className="navbar navbar-expand-lg navbar-light bg-light">
                    <Link to="/recruiters/recruiterprofile" className="navbar-brand">My Profile</Link>
                    <div className="collapse navbar-collapse">
                        <ul className="navbar-nav mr-auto">
                             <li className="navbar-item">
                                <Link to="/recruiters/addjob" className="nav-link">Add Job</Link>
                            </li>
                             <li className="navbar-item">
                                <Link to="/recruiters/viewjobs" className="nav-link">View Added Jobs</Link>
                            </li>
                            <li className="navbar-item">
                                <Link to="/recruiters/acceptedpage" className="nav-link">View Accepted Applicants</Link>
                            </li>
                            <Button variant="contained" color="secondary" onClick={this.logout} disableElevation>Logout</Button>
                            {/* <li className="navbar-item">
                                <Link to="/profile" className="nav-link">My Profile</Link>
                            </li>                              */}
                        </ul>
                    </div>
                </nav>
            </div>
        )
    }
}
